import { BsCartCheckFill } from "react-icons/bs";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return(
    <div cla>
      <div className="flex flex-row justify-between">
        <NavLink  to="/">
          <div>
          <img src="https://static1.bigstockphoto.com/2/3/3/large1500/332817859.jpg"/>
          </div>
        </NavLink>

       <div>
        <NavLink to="/">
        <p>Home</p>
         </NavLink>

         <NavLink to="/cart">
          <div>
                <BsCartCheckFill />
          </div>
         </NavLink>


       </div>
      </div>
    </div>
  )
};

export default Navbar;
